import  React, { Component } from "react"
import {ScreenLayouts} from "./FormLayouts"
import DVForms from "../DVComponents/DVForms";

type formId = {
    Idd: string
}

export class FormBuilder extends React.Component<formId> {
    constructor(props){
        super(props);
    }
    render() {
      return (
            <div>
                <h1>{this.props.Idd}</h1>
                <h1>{JSON.stringify(ScreenLayouts[this.props.Idd])}</h1>
                <DVForms template={ScreenLayouts[this.props.Idd]} value={ScreenLayouts["LoginScreenValue"]}></DVForms>
            </div>
        );
    }
  }
  export default FormBuilder;
